        <Tabs value={currentTab} centered variant='standard' onChange={handleChange()}>
          <Tab label="All" />
          <Tab label="React" />
          <Tab label="Django" />
          <Tab label="java" />
        </Tabs>

      </div>
    </Container>
  )
}

export default Projects
